The MovieClip class associates a TimelineTween Timeline with a {{#crossLink "Sprite"}}{{/crossLink}}. It allows
you to create objects which encapsulate timeline animations, state changes, and synched actions. Due to the
complexities inherent in correctly setting up a MovieClip, it is largely intended for tool output.

Currently MovieClip only works properly if it is tick based (as opposed to time based) though some concessions have
been made to support time-based timelines in the future.

@param mode Initial value for the mode property. One of MovieClip.INDEPENDENT, MovieClip.SINGLE_FRAME, or MovieClip.SYNCHED.
@param startPosition Initial value for the startPosition property.
@param loop Initial value for the loop property.
@param labels A hash of labels to pass to the timeline instance associated with this MovieClip.

The [Transition] class animates a value by calling the [onUpdate] function continuously.

    var transition = new Transition(0.0, 100.0, 1.0, TransitionFunction.linear);
    transition.onUpdate = (value) => print('the value changed to $value');
    renderLoop.juggler.add(transition);

The [Tween] class animates the properties of a [DisplayObject].
Use one of the [TransitionFunction] functions or create your own.
Add the instance to the [Juggler] to start the animation.

    var tween = new Tween(mySprite, 1.0, TransitionFunction.easeInCubic);
    tween.delay = 0.5;
    tween.animate("alpha", 0.0);
    tween.onComplete = () => print('completed');
    renderLoop.juggler.add(tween);
